import React from "react"
export default class Navbar extends React.Component{
  render(){
    return(
      <nav className="nav">
        <a className="site-title" href="/">LecSum</a>
        <ul>
          <li>
            <a href="/">API's</a>
            <a href="/">NLP Algorithm</a>
          </li>
        </ul>
      </nav>
    )
  }
}
